//{{{  makeMove

function makeMove (move) {

  const s = state;
  const b = s.board;

  const fr    = moveFromSq(move);
  const to    = moveToSq(move);
  const frObj = moveFromObj(move);

  b[fr] = 0;
  b[to] = frObj;

  s.turn = colourToggle(s.turn);
  s.rights &= MASK_RIGHTS[fr] & MASK_RIGHTS[to];
  s.ep = 0;

  if (move & MOVE_IKKY_MASK)
    makeIkkyMove(move);
}

